import React from "react";
import { Link } from "react-router-dom";

const Header = props => {
  return (
    <div>
      <img src="https://res.cloudinary.com/justin-bresee/image/upload/v1580358986/Internskip/internskip_logo_x2n2pm.png" />
      <Link to="/">Home</Link>
      <Link to="/about">About</Link>
      <Link to="/login">Login</Link>
    </div>
  );
};

export default Header;
